query:
fragment listingFragment on Listing {
  numberOfVideos
  numberOfImages
  numberOfFloorPlans
  numberOfViews
  listingId
  title
  publishedOnLabel
  publishedOn
  availableFrom
  priceDrop {
    lastPriceChangeDate
    percentageChangeLabel
    __typename
  }
  isPremium
  highlights {
    description
    label
    url
    __typename
  }
  otherPropertyImages {
    small
    large
    caption
    __typename
  }
  branch {
    name
    branchDetailsUri
    phone
    logoUrl
    __typename
  }
  features {
    content
    iconId
    __typename
  }
  image {
    src
    caption
    responsiveImgList {
      width
      src
      __typename
    }
    __typename
  }
  transports {
    title
    poiType
    distanceInMiles
    features {
      zone
      tubeLines
      __typename
    }
    __typename
  }
  flag
  listingId
  priceTitle
  shortPriceTitle
  price
  address
  tags {
    content
    __typename
  }
  listingUris {
    contact
    detail
    __typename
  }
  location {
    coordinates {
      latitude
      longitude
      __typename
    }
    __typename
  }
  __typename
}

query getListingMapView($path: String!) {
  searchResults(path: $path) {
    analyticsTaxonomy {
      activity
      areaName
      bedsMax
      bedsMin
      brand
      countryCode
      countyAreaName
      currencyCode
      emailAllFormShown
      emailAllTotalAgents
      expandedResultsCount
      listingsCategory
      location
      outcode
      outcodes
      page
      postalArea
      priceMax
      priceMin
      propertyType
      radius
      radiusAutoexpansion
      regionName
      resultsSort
      searchGuid
      searchIdentifier
      searchLocation
      searchResultsCount
      section
      totalResults
      url
      viewType
      __typename
    }
    analyticsEcommerce {
      currencyCode
      impressions {
        id
        list
        position
        variant
        __typename
      }
      __typename
    }
    metaInfo {
      title
      description
      canonicalUri
      __typename
    }
    pagination {
      pageNumber
      totalResults
      totalResultsWasLimited
      __typename
    }
    listings {
      regular {
        ...listingFragment
        __typename
      }
      featured {
        ...listingFragment
        __typename
      }
      extended {
        ...listingFragment
        __typename
      }
      __typename
    }
    filters {
      fields {
        group
        fieldName
        label
        isRequired
        inputType
        placeholder
        allowMultiple
        options
        value
        __typename
      }
      __typename
    }
    sortOrder {
      currentSortOrder
      options {
        i18NLabelKey
        value
        __typename
      }
      __typename
    }
    seoBlurb {
      category
      transactionType
      __typename
    }
    links {
      saveSearch
      createAlert
      __typename
    }
    polygonV2(path: $path) {
      polygons
      radius
      geoData {
        coordinates
        __typename
      }
      geoType
      __typename
    }
    polyenc
    __typename
  }
}
